import React,{ Component } from 'react'
import { getCategories, getArticleById, getArticles, getCommentsByArticleId } from '../../fake-api';
import Datetime from '../Datetime'

export default class ApiArt extends Component{
  async helloAsync(){
    const a= await getArticles();
    const c= await getCommentsByArticleId();
    
    console.log('asd',a);
    const b = a.data.articles[0].author_user_info.user_name
    const d = c.data.comments[0].comment_info.comment_content
    // console.log('aasd',d);
    const f = Datetime(a.data.articles[0].article_info.ctime*1000)
    const g = a.data.articles[0].category_info
    const h = a.data.articles[0].article_info
    // console.log(a.data.articles[0].article_info.ctime);
    console.log(g);
    const e = [b,d,f,g,h]
    this.setState({
      art:e[0],com:e[1],ctime:e[2],
      cateName:{
        first_category_name:e[3].first_category_name,
        second_category_name:e[3].second_category_name},
      brief_content:e[4].brief_content,title:e[4].title,cover_image:e[4].cover_image,audit_status:e[4].audit_status,collect_count:e[4].collect_count,comment_count:e[4].comment_count,
      ApiArt: [this.state.art,this.state.ctime,this.state.cateName.first_category_name,this.state.cateName.second_category_name,this.state.title,this.state.cover_image,this.state.brief_content,this.state.audit_status,this.state.collect_count,this.state.comment_count],
      success:true},()=>{console.log(this.state.success)}
    )

  }
  render(){
     const ApiArt= this.state.ApiArt
    return (
      <div className='apiArt'>
        <div className='apiArt2'>
          <div className='apiArt3'>
            <ul className='apiArtul'>
              <li className='apiArtli'>{ApiArt[0]}</li>
              <li className='apiArtli'>{ApiArt[1]}</li>
              <li className='apiArtli'>{ApiArt[2]}&nbsp;&nbsp;Â·&nbsp;&nbsp;{ApiArt[3]}</li>
            </ul>
            <div className='apiArt4'>
              <span className='apiArtspan1'>{ApiArt[4]}</span>
              <img src={ApiArt[5]} alt="img" />
              <span className='apiArtspan2'>{ApiArt[6]}</span>
              <ul className='apiArtul'>
                <li className='apiArtli2'>
                  <img src="//lf3-cdn-tos.bytescm.com/obj/static/xitu_juejin_web/img/view.1eda8fa.png" alt="eye" />
                  &nbsp;{ApiArt[7]}
                </li>
                <li className='apiArtli2'>
                <img src="data:image/png;base64," alt="like" />
                  &nbsp;{ApiArt[8]}
                </li>
                <li className='apiArtli2'>
                <img src="data:image/png;base64," alt="comments" />
                  &nbsp;{ApiArt[9]}
                </li>
                <li className='apiArtli2'></li>
              </ul>
            </div>
            
          </div>
        </div>
      </div>
    )
  }
  
}
